83,"end_time":"2025-08-13T02:24:45.18905","exception":false,"start_time":"2025-08-13T02:24:45.182167","status":"completed"},"tags":[]},"source":["**1. Introduction**\n","\n","Football, also known as soccer, ‘passion of multitudes’, or ‘the beautiful game’, is the \n","favourite sport for the majority of the planet. It has over three billion spectators, the \n","largest number of professional players, and the highest market valuation of all sports \n","(Marchiori & Vecchi, 2020). \n","This proposed work aims to explore questions like which were the most competitive \n","leagues, the most prolific teams from the top five European leagues, and the \n","characteristics of star figures in comparison with different levels of players. "]},{"attachments":{"0c8cfdda-d2af-4fde-a089-0141f94d2065.png":{"image/png":""},"850c5f84-3267-43a5-8706-ff51d571a6a9.png":{"image/png":""}},"cell_type":"markdown","id":"e1eeafb5","metadata":{"papermill":{"duration":0.00676,"end_time":"2025-08-13T02:24:45.20248","exception":false,"start_time":"2025-08-13T02:24:45.19572","status":"completed"},"tags":[]},"source":["**2. Data sources**\n","\n","To achieve the proposed goals, the ‘European Soccer Database’ from Kaggle will be used. \n","It gathers data from eleven countries domestic main championships from seasons \n","between 2008 and 2016. It was collected by Kaggle user Hugo Mathien, who sourced the \n","information from http://football-data.mx-api.enetscores.com/, http://www.football\n","data.co.uk/, and http://sofifa.com/. The database has detailed match information, teams \n","and player attributes obtained from EA Sports FIFA games, team lineups, and even \n","betting odds information; this last one will not be used on these endeavours. The \n","information can be downloaded from the ‘database.sqlite’ file, which contains the \n","following tables: \n","\n","![image.png](attachment:850c5f84-3267-43a5-8706-ff51d571a6a9.png)\n","\n","It is important to note that the information does not include international clubs’ \n","competitions, national cups, or information about who scored the goals in the matches."]},{"cell_type":"markdown","id":"0f86ee47","metadata":{"papermill":{"duration":0.006682,"end_time":"2025-08-13T02:24:45.216037","exception":false,"start_time":"2025-08-13T02:24:45.209355","status":"completed"},"tags":[]},"source":["**Note:** The information of the table above can be found in the Data Card of the dataset in Kaggle."]},{"cell_type":"code","execution_count":3,"id":"010865e1","metadata":{"execution":{"iopub.execute_input":"2025-08-13T02:24:45.233882Z","iopub.status.busy":"2025-08-13T02:24:45.231769Z","iopub.status.idle":"2025-08-13T02:25:03.134968Z","shell.execute_reply":"2025-08-13T02:25:03.13326Z"},"papermill":{"duration":17.914988,"end_time":"2025-08-13T02:25:03.137821","exception":false,"start_time":"2025-08-13T02:24:45.222833","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["[1] \"Country\"\n","[1] \"id\"   \"name\"\n","[1] \"League\"\n","[1] \"id\"         \"country_id\" \"name\"      \n","[1] \"Match\"\n","  [1] \"id\"               \"country_id\"       \"league_id\"       \n","  [4] \"season\"           \"stage\"            \"date\"            \n","  [7] \"match_api_id\"     \"home_team_api_id\" \"away_team_api_id\"\n"," [10] \"home_team_goal\"   \"away_team_goal\"   \"home_player_X1\"  \n"," [13] \"home_player_X2\"   \"home_player_X3\"   \"home_player_X4\"  \n"," [16] \"home_player_X5\"   \"home_player_X6\"   \"home_player_X7\"  \n"," [19] \"home_player_X8\"   \"home_player_X9\"   \"home_player_X10\" \n"," [22] \"home_player_X11\"  \"away_player_X1\"   \"away_player_X2\"  \n"," [25] \"away_player_X3\"   \"away_player_X4\"   \"away_player_X5\"  \n"," [28] \"away_player_X6\"   \"away_player_X7\"   \"away_player_X8\"  \n"," [31] \"away_player_X9\"   \"away_player_X10\"  \"away_player_X11\" \n"," [34] \"home_player_Y1\"   \"home_player_Y2\"   \"home_player_Y3\"  \n"," [37] \"home_player_Y4\