,"[4] \"player_fifa_api_id\" \"birthday\"           \"height\"            \n","[7] \"weight\"            \n","[1] \"Player_Attributes\"\n"," [1] \"id\"                  \"player_fifa_api_id\"  \"player_api_id\"      \n"," [4] \"date\"                \"overall_rating\"      \"potential\"          \n"," [7] \"preferred_foot\"      \"attacking_work_rate\" \"defensive_work_rate\"\n","[10] \"crossing\"            \"finishing\"           \"heading_accuracy\"   \n","[13] \"short_passing\"       \"volleys\"             \"dribbling\"          \n","[16] \"curve\"               \"free_kick_accuracy\"  \"long_passing\"       \n","[19] \"ball_control\"        \"acceleration\"        \"sprint_speed\"       \n","[22] \"agility\"             \"reactions\"           \"balance\"            \n","[25] \"shot_power\"          \"jumping\"             \"stamina\"            \n","[28] \"strength\"            \"long_shots\"          \"aggression\"         \n","[31] \"interceptions\"       \"positioning\"         \"vision\"             \n","[34] \"penalties\"           \"marking\"             \"standing_tackle\"    \n","[37] \"sliding_tackle\"      \"gk_diving\"           \"gk_handling\"        \n","[40] \"gk_kicking\"          \"gk_positioning\"      \"gk_reflexes\"        \n","[1] \"Team\"\n","[1] \"id\"               \"team_api_id\"      \"team_fifa_api_id\" \"team_long_name\"  \n","[5] \"team_short_name\" \n","[1] \"Team_Attributes\"\n"," [1] \"id\"                             \"team_fifa_api_id\"              \n"," [3] \"team_api_id\"                    \"date\"                          \n"," [5] \"buildUpPlaySpeed\"               \"buildUpPlaySpeedClass\"         \n"," [7] \"buildUpPlayDribbling\"           \"buildUpPlayDribblingClass\"     \n"," [9] \"buildUpPlayPassing\"             \"buildUpPlayPassingClass\"       \n","[11] \"buildUpPlayPositioningClass\"    \"chanceCreationPassing\"         \n","[13] \"chanceCreationPassingClass\"     \"chanceCreationCrossing\"        \n","[15] \"chanceCreationCrossingClass\"    \"chanceCreationShooting\"        \n","[17] \"chanceCreationShootingClass\"    \"chanceCreationPositioningClass\"\n","[19] \"defencePressure\"                \"defencePressureClass\"          \n","[21] \"defenceAggression\"              \"defenceAggressionClass\"        \n","[23] \"defenceTeamWidth\"               \"defenceTeamWidthClass\"         \n","[25] \"defenceDefenderLineClass\"      \n","[1] \"sqlite_sequence\"\n","[1] \"name\" \"seq\" \n"]}],"source":["# 1.1 Load dataset\n","con <- dbConnect(SQLite(), dbname = \"/kaggle/input/soccer/database.sqlite\")\n","\n","# In RStudio use\n","# con <- dbConnect(SQLite(), dbname = \"database.sqlite\")\n","\n","Tables_sql <- dbListTables(con)\n","\n","for (table_sql in Tables_sql) {\n","  print(table_sql)\n","  print(dbListFields(con, table_sql))\n","}\n","\n","# Asigning variables to the different tables\n","Country_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Country\"))\n","League_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM League\"))\n","Match_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Match\"))\n","Player_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Player\"))\n","Player_Attributes_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Player_Attributes\"))\n","Team_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Team\"))\n","Team_Attributes_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM Team_Attributes\"))\n","sqlite_sequence_df <- as.data.frame(dbGetQuery(con, \"SELECT * FROM sqlite_sequence\"))\n","\n","dbDisconnect(con)"]},{"cell_type":"markdown","id":"c6dcc2cb","metadata":{"papermill":{"duration":0.007153,"end_time":"2025-08-13T02:25:03.152319","exception":false,"start_time":"2025-08-13T02:25:03.145166","status":"completed"},"tags":[]},"source":["**Note:** The questions below will be resolved in the Project Report (European Soccer 08/16 - 2 of 2), not in this Project Plan.\n","* I recommend doing this once you have a good grasp of what the data is about and what you can do with it.\n","* Also, is good to have assumptions about questions that you can answer with the data, maybe you can answer them only with this data or combining another dataset."]},{"cell_type":"markdown","id":"b8fec3c3","metadata":{"papermill":{"duration":0.006858,"end_time":"2025-08-13T02:25:03.16589","exception":false,"start_time":"2025-08-13T02:25:03.159032","status":"completed"},"tags":[]},"source":["**3. Project Plan**\n","\n","**Overall-level questions**\n","* What percentage of games are won by the local team, tied, or won by the away \n","team per league? \n","* Which are the most competitive leagues? meaning there are no clear solitary \n","contenders among seasons.    \n","For this last graph, a clear measure of competitiveness should be created. \n","\n","**Intermediate-level questions**\n","* Which are the ten teams with the most average goals per match, divided by home \n","and away goals? \n","* Which were the most effective teams each season from the five most competitive \n","leagues? \n","For the last question, a measure of effectiveness should be established. \n","\n","**Elementary-level questions**\n","* How do the attributes of the best two players compare to each other at same \n","ages? \n","* How do the best two players at their prime compare to the 25/50/75 percentiles \n","of players on different attributes? "]},{"cell_type":"markdown","id":"4fd46e57","metadata":{"papermill":{"duration":0.007557,"end_time":"2025-08-13T02:25:03.180153","exception":false,"start_time":"2025-08-13T02:25:03.172596","status":"completed"},"tags":[]},"source":["**4. Data preparation**\n","\n","Two important merges are necessary to have a better understanding of the data. The first \n","is merging the ‘Match’ table with ‘Country’, ‘League’, and ‘Teams’. The second is \n","‘Player_Attributes’ with ‘Player’. The tables ‘Team_Attributes’ and ‘sqlite_sequence’ will \n","not be used. \n","After merging the different tables, some columns should be eliminated as they will not \n","be used for the purposes of this work, e.g., bookies information and team formations. \n","Then some columns with calculated values are added to each table. \n"]},{"cell_type":"code","execution_count":4,"id":"ea2aa1e2","metadata":{"execution":{"iopub.execute_input":"2025-08-13T02:25:03.19753Z","iopub.status.busy":"2025-08-13T02:25:03.196012Z","iopub.status.idle":"2025-08-13T02:25:03.26452Z","shell.execute_reply":"2025-08-13T02:25:03.262944Z"},"papermill":{"duration":0.079753,"end_time":"2025-08-13T02:25:03.26669","exception":false,"start_time":"2025-08-13T02:25:03.186937","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A data.frame: 20 × 2</caption>\n","<thead>\n","\t<tr><th></th><th scope=col>missing_count</th><th scope=col>missing_prop</th></tr>\n","\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><th scope=row>goal</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>shoton</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>shotoff</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>foulcommit</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>card</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>cross</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>corner</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>possession</th><td>11762</td><td>45.27503</td></tr>\n","\t<tr><th scope=row>PSH</th><td>14811</td><td>57.01143</td></tr>\n","\t<tr><th scope=row>PSD</th><td>14811</td><td>57.01143</td></tr>\n","\t<tr><th scope=row>PSA</th><td>14811</td><td>57.01143</td></tr>\n","\t<tr><th scope=row>SJH</th><td> 8882</td><td>34.18915</td></tr>\n","\t<tr><th scope=row>SJD</th><td> 8882</td><td>34.18915</td></tr>\n","\t<tr><th scope=row>SJA</th><td> 8882</td><td>34.18915</td></tr>\n","\t<tr><th scope=row>GBH</th><td>118