d','team_long_name')], by.x = 'home_team_api_id', by.y = 'team_api_id')\n","\n","# Rename 'team_long_name' column to 'home_team'\n","Match_Merged_df <- Match_Merged_df %>%\n","  rename(home_team = team_long_name)\n","\n","# Merge with team info Away\n","Match_Merged_df <- merge(Match_Merged_df, Team_df[,c('team_api_id','team_long_name')], by.x = 'away_team_api_id', by.y = 'team_api_id')\n","\n","# Rename 'team_long_name' column to 'away_team'\n","Match_Merged_df <- Match_Merged_df %>%\n","  rename(away_team = team_long_name)\n","\n","# Change Date Type\n","Match_Merged_df$date <- ymd_hms(Match_Merged_df$date)\n","Match_Merged_df$date <- ymd(Match_Merged_df$date)\n","\n","# Create New Column as 'total_no_goals'= 'home_team_goal'+'away_team_goal'\n","Match_Merged_df$Total_goals <- Match_Merged_df$home_team_goal +Match_Merged_df$away_team_goal\n","\n","# Create new column 'Result' that identifies the result of the match (HTW: Home Team Win, ATW: Away team Win, D: Draw)\n","Match_Merged_df$Result <- ifelse(Match_Merged_df$home_team_goal > Match_Merged_df$away_team_goal, 'HTW',\n","                                 ifelse(Match_Merged_df$home_team_goal < Match_Merged_df$away_team_goal, 'ATW',\n","                                 'DRAW'))\n","\n","# Create new column 'winning_team' that identifies the winning team\n","Match_Merged_df$Winning_team <- ifelse(Match_Merged_df$Result == 'HTW', Match_Merged_df$home_team, \n","                                       ifelse(Match_Merged_df$Result == 'ATW', Match_Merged_df$away_team, '0'))\n","\n","# Create new column 'losing_team' that identifies the losing team\n","Match_Merged_df$Losing_team <- ifelse(Match_Merged_df$Result == 'HTW', Match_Merged_df$away_team, \n","                                       ifelse(Match_Merged_df$Result == 'ATW', Match_Merged_df$home_team, '0'))\n","\n","head(Match_Merged_df)\n","\n","#grep('country_id.y$', colnames(Clean_Match_df))\n","\n","Clean_Match_df <- Match_Merged_df[,-c(4,12:55)]\n","Clean_M