,"# Plot the number of Goals per Teams by Season - Boxplot\n","ggplot(Goals_Merged_df, aes(x = season, y = Total_Goals)) +\n","  geom_boxplot(fill = \"#499699\", color = \"#33419e\") +\n","  labs(title = \"Distribution of Total Scored Goals \\nby Teams on each Season\",\n","       x = \"Seasons\",\n","       y = \"Total Goals\") +\n","   coord_flip() +\n","  theme_test() +\n","  scale_y_continuous(breaks = seq(0, 125, by = 10)) +\n","  theme(plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"5fe6cd98","metadata":{"papermill":{"duration":0.01145,"end_time":"2025-08-13T02:25:05.692162","exception":false,"start_time":"2025-08-13T02:25:05.680712","status":"completed"},"tags":[]},"source":["A general view of the team's performance in each season can be achieved by analysing the \n","distribution of goals scored by each team. Through all the seasons, 25% of the teams have less \n","than 40 goals; they have similar medians between 40 and 50 goals; 75% have less than 60 goals; \n","most distributions are right-skewed; and they all have outliers towards high values. Only the \n","season 2013/2014 had two teams with less than 10 goals. The skewness of the distributions is \n","most probably due to the higher number of matches in some leagues. "]},{"cell_type":"code","execution_count":9,"id":"e876bdf2","metadata":{"execution":{"iopub.execute_input":"2025-08-13T02:25:05.718562Z","iopub.status.busy":"2025-08-13T02:25:05.717013Z","iopub.status.idle":"2025-08-13T02:25:06.348468Z","shell.execute_reply":"2025-08-13T02:25:06.34666Z"},"papermill":{"duration":0.647518,"end_time":"2025-08-13T02:25:06.351106","exception":false,"start_time":"2025-08-13T02:25:05.703588","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddUAUaR8H8N9sw9IpaWAHyFl4KuphB2ChWNh16tmIrady3tmKgeKpqHh2e3d6\nZ73qeXag2IkKSNf2vH8s4kosYQBz389fu888M/N7ZtD97tQyLMsSAAAAAJR9vJIuAAAAAAA+\nDwQ7AAAAAI5AsAM