\n","Goals_by_league_A <- Clean_Match_df %>%\n","  group_by(League) %>%\n","  summarise(Tot_Away_team_goal = sum(away_team_goal))\n","\n","Goals_by_league <- merge(Goals_by_league_H, Goals_by_league_A, by.x = 'League', by.y = 'League')\n","\n","League_games <- Clean_Match_df %>%\n","  group_by(League) %>%\n","  summarise(Number_of_games = n())\n","\n","Goals_by_league <- merge(Goals_by_league, League_games, by.x = 'League', by.y = 'League')\n","\n","Goals_by_league$Home <- Goals_by_league$Tot_Home_team_goal / Goals_by_league$Number_of_games\n","\n","Goals_by_league$Away <- Goals_by_league$Tot_Away_team_goal / Goals_by_league$Number_of_games\n","\n","Goals_by_league <- Goals_by_league[,-c(2:4)]\n","\n","\n","\n","Goals_by_league_long <- gather(Goals_by_league, Goals_Type, Goals_Avg, Home:Away, factor_key=TRUE)\n","\n","Goals_by_league_long_2 <- Goals_by_league_long %>%\n","  group_by(League) %>%\n","  mutate(Total = sum(Goals_Avg)) %>%\n","  ungroup() %>%\n","  arrange(desc(Total))\n","\n","Goals_by_league_long_2$League <- factor(Goals_by_league_long_2$League)\n","\n","Goals_by_league_long_2$Goals_Avg <- round(Goals_by_league_long_2$Goals_Avg, 2)\n","\n","\n","# Plot the Home/Away goals on Average\n","ggplot(Goals_by_league_long_2, aes(x = reorder(League, Total), y = Goals_Avg, fill = Goals_Type)) +\n","  geom_bar(stat = \"identity\") +\n","  scale_fill_manual(values = c('Home' = '#a6cee3', 'Away' = '#1f78b4'),\n","    labels = c('Home' = 'Home Team', 'Away' = 'Away Team')) +\n","  labs(title = \"Average Goals per Match\",\n","       x = \"\",\n","       y = \"Average Goals\",\n","       fill = \"Goals Scored\") +\n","  geom_text(aes(label = Goals_Avg), position = position_stack(vjust = 0.5)) +\n","  coord_flip() +       \n","  theme_classic() + \n","  theme(plot.title = element_text(hjust = 0.5))"]},{"cell_type":"markdown","id":"f8836c58","metadata":{"papermill":{"duration":0.013163,"end_time":"2025-08-13T02:25:06.378399","exception":false,"start_time":"2025-08-13T0